import React, { Component } from 'react';


class Nav extends Component {
    render() { 

        const navStyle = {
            display: 'flex',
            alignItems: 'center',
            minHeight: '130px',
            backgroundColor: '#FFFFFFF',
            borderBottom: '20px #E1C3C7 solid',
            padding: '0px 20px'
        }

        const navItems = {
            listStyleType: 'none',
            fontFamily: 'avenir'
        }

        const logo = {
            width: '135px',
            height: '35px'
        }

        return(
            <nav style={navStyle}>
                <img src='./images/logo.png' />
                <ul style={navItems}>
                    <li>Merchant Portal</li>
                </ul>
            </nav>
        );
    }
}

export default Nav;
